import React from 'react';

import './signin.css';
const Signin = () => {
   
    return (
        <div className="form_container">
            <form >
                <input type="email" placeholder="Email" />
                <input type="password" placeholder="Email" />
                <button  type="submit">Detect</button>
            </form>
        </div>
        
    );
}
export default Signin;
